INSERT INTO `v1_c81bd78f7cc32a9f358d712c5da9d85f378921524258733d98c3b8aae1323a69` VALUES (0, 0, 1, 1, 1.4, "虹村 雪", "いいよ。\n見られることは運命さ…", 1, "ボクは虹村雪。", "キミもボクの美貌に\n吸い寄せられたんだね。", 0, 2, 1008, 0, 0);
INSERT INTO `v1_c81bd78f7cc32a9f358d712c5da9d85f378921524258733d98c3b8aae1323a69` VALUES (0, 0, 1, 1, 1.4, "柊杏奈", "人呼んで「疾風の冥姫」!!", 1, "フッ…聞いて後悔するがいい！", "我が真名は\nアンネローゼ・フォン・シュテッヒパルム！", 0, 2, 1009, 0, 0);
INSERT INTO `v1_c81bd78f7cc32a9f358d712c5da9d85f378921524258733d98c3b8aae1323a69` VALUES (0, 0, 1, 1, 1.5, "姫宮 真歩", "ほんまおおきにやわ～♪", 1, "マホマホ王国のプリンセス、\nまほ姫どす", "うさぎさん、\n運命の王子はんに巡りあわせてくれて", 0, 2, 1010, 0, 0);
INSERT INTO `v1_c81bd78f7cc32a9f358d712c5da9d85f378921524258733d98c3b8aae1323a69` VALUES (0, 0, 1, 1, 1.4, "衣之咲 璃乃", "ここで会ったが\n100年目～！", 1, "衣之咲璃乃です！", "生き別れたお兄ちゃんを探して\n三千世界！", 0, 2, 1011, 0, 0);
INSERT INTO `v1_c81bd78f7cc32a9f358d712c5da9d85f378921524258733d98c3b8aae1323a69` VALUES (0, 0, 1, 1, 1.4, "柏崎 初音", "…って、お願い！\n誰にも言わないでおいて～！", 1, "私はハツネ、\n結構強いんだよ。\nきらーん☆", "ち、超能力って…\n何のことかな～？", 0, 2, 1012, 0, 0);
INSERT INTO `v1_c81bd78f7cc32a9f358d712c5da9d85f378921524258733d98c3b8aae1323a69` VALUES (0, 0, 1, 1, 1.4, "美波 鈴奈", "ヒデサイまぢ\nGF（グッドフィーリング）～♪", 1, "ちょす！\n美波鈴奈だよ～♪", "一応カリスマ読モJKやってまっす！", 0, 2, 1016, 0, 0);
