INSERT INTO `v1_c81bd78f7cc32a9f358d712c5da9d85f378921524258733d98c3b8aae1323a69` VALUES (0, 0, 1, 1, 1.5, "栗林 くるみ", "ふぇぇぇぇぇん……", 1, "あ…あの…えっと…\n栗…林…くるみ…です……", "あの……\nふぇ……", 0, 2, 1021, 0, 0);
