INSERT INTO `v1_c81bd78f7cc32a9f358d712c5da9d85f378921524258733d98c3b8aae1323a69` VALUES (0, 0, 1, 1, 1.4, "佐々木 咲恋", "…そうでしょ？？", 1, "佐々木咲恋よ。\nねえ、世の中に無駄なことが\n多すぎると思わない？", "その無駄を省くことができれば、\nもっと余裕のある暮らしができるっ！", 0, 2, 1028, 0, 0);
